import axios from "axios";
import { useState } from "react";
import { useNavigate, useParams } from "react-router-dom";

const URI = 'http://localhost:8000/createEncargado/';

const CompCreateEncargado = () => {
    const navigate = useNavigate();
    const { ID_Deportivo } = useParams();
    const [Nombre, setNombre] = useState('');
    const [Primer_Apellido, setPrimerApellido] = useState('');
    const [Segundo_Apellido, setSegundoApellido] = useState('');
    const [Telefono_Fijo, setTelefonoFijo] = useState('');
    const [Telefono_Movil, setTelefonoMovil] = useState('');
    const [Cargo, setCargo] = useState('');
    const [RFC_CURP, setRFCCURP] = useState('');
    const [Contraseña, setContraseña] = useState('');
    const [error, setError] = useState(null);

    const store = async (e) => {
        e.preventDefault();
        try {
            await axios.post(URI, {
                Nombre: Nombre,
                ID_Deportivo: ID_Deportivo,
                Primer_Apellido: Primer_Apellido,
                Segundo_Apellido: Segundo_Apellido,
                Telefono_Fijo: Telefono_Fijo,
                Telefono_Movil: Telefono_Movil,
                Cargo: Cargo,
                RFC_CURP: RFC_CURP,
                Contraseña: Contraseña
            });
            navigate('/');
        } catch (error) {
            setError(error.response.data.error);
        }
    };

    return (
        <div className="formulario">
            <h1>Asignar encargado</h1>
            {error && <div className="alert alert-danger">{error}</div>}
            <form onSubmit={store}>
                <div className="form-group">
                    <label>Nombre</label>
                    <input type="text" value={Nombre} onChange={(e) => setNombre(e.target.value)} className="form-control" required />
                </div>
                <div className="form-group">
                    <label>Primer Apellido</label>
                    <input type="text" value={Primer_Apellido} onChange={(e) => setPrimerApellido(e.target.value)} className="form-control" required />
                </div>
                <div className="form-group">
                    <label>Segundo Apellido</label>
                    <input type="text" value={Segundo_Apellido} onChange={(e) => setSegundoApellido(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Teléfono Fijo</label>
                    <input type="text" value={Telefono_Fijo} onChange={(e) => setTelefonoFijo(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Teléfono Móvil</label>
                    <input type="text" value={Telefono_Movil} onChange={(e) => setTelefonoMovil(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>Cargo</label>
                    <input type="text" value={Cargo} onChange={(e) => setCargo(e.target.value)} className="form-control" />
                </div>
                <div className="form-group">
                    <label>RFC/CURP (Máximo 16 caracteres)</label>
                    <input type="text" value={RFC_CURP} onChange={(e) => setRFCCURP(e.target.value)} className="form-control" maxLength="16" required />
                </div>
                <div className="form-group">
                    <label>Contraseña</label>
                    <input type="password" value={Contraseña} onChange={(e) => setContraseña(e.target.value)} className="form-control" required />
                </div>
                <button type="submit" className="btn btn-primary">Asignar encargado</button>
            </form>
        </div>
    );
}

export default CompCreateEncargado;
